import { Routes, Route } from 'react-router-dom';
import { Link } from 'react-router-dom';

import ContextProvider from '../../utils/context/context';

import Dashboard from '../Dashboard/Dashboard';

import useFetch from '../../utils/hooks/hook';

import './Home.css';

const Home = () => {
	// const userId = 12;
	const { data, loading, error } = useFetch('http://localhost:8080/user/:thing');
	console.log(
		'data : ',
		data,
		'\n=====================',
		'\nloading : ',
		loading,
		'\n=====================',
		'\nerror : ',
		error
	);

	return (
		<ContextProvider>
			<Link to="/user/12">
				<img
					src="https://doodleipsum.com/700/avatar?i=3cdf1e1375692dbe37689851492c2957"
					className="user__avatar"
					alt="Avatar by Gustavo Pedrosa"
				/>
			</Link>
			<Link to="/user/12">
				<img
					src="https://doodleipsum.com/700/avatar?i=aaae4ac68a7288537c3192c776e5afab"
					className="user__avatar"
					alt="Avatar by Gustavo Pedrosa"
				/>
			</Link>
			<Routes>
				<Route path="/user/:id" element={<Dashboard />} />
			</Routes>
		</ContextProvider>
	);
};

export default Home;
